import React, { Component } from 'react';
import axios from 'axios';


import {
     Form, Input, Tooltip, Icon, Cascader, Select, Row, Col, Checkbox, Button, AutoComplete,
   } from 'antd';

   const { Option } = Select;
   const AutoCompleteOption = AutoComplete.Option;
   const { TextArea, List} = Input;
   // const residences = [{
   //   value: 'zhejiang',
   //   label: 'Zhejiang',
   //   children: [{
   //     value: 'hangzhou',
   //     label: 'Hangzhou',
   //     children: [{
   //       value: 'xihu',
   //       label: 'West Lake',
   //     }],
   //   }],
   // }, {
   //   value: 'jiangsu',
   //   label: 'Jiangsu',
   //   children: [{
   //     value: 'nanjing',
   //     label: 'Nanjing',
   //     children: [{
   //       value: 'zhonghuamen',
   //       label: 'Zhong Hua Men',
   //     }],
   //   }],
   // }];

   class UserData extends React.Component {
     state = {
       confirmDirty: false,
       autoCompleteResult: [],
     };



     render() {
       const { getFieldDecorator } = this.props.form;
       const { autoCompleteResult } = this.state;

       const formItemLayout = {
         labelCol: {
           xs: { span: 24 },
           sm: { span: 8 },
         },
         wrapperCol: {
           xs: { span: 24 },
           sm: { span: 16 },
         },
       };
       const tailFormItemLayout = {
         wrapperCol: {
           xs: {
             span: 24,
             offset: 0,
           },
           sm: {
             span: 16,
             offset: 8,
           },
         },
       };
       const prefixSelector = getFieldDecorator('prefix', {
         initialValue: '86',
       })(
         <Select style={{ width: 70 }}>
           <Option value="86">+86</Option>
           <Option value="87">+87</Option>
         </Select>
       );

       const websiteOptions = autoCompleteResult.map(website => (
         <AutoCompleteOption key={website}>{website}</AutoCompleteOption>
       ));

       return (
         <Form >
           <Form.Item
             {...formItemLayout}
             label="Email">
               <Input readOnly value = "Hi"/>
           </Form.Item>
           <Form.Item
             {...formItemLayout}
             label="Personal Description"
           >
             <TextArea rows={4} readOnly/>
           </Form.Item>
           <Form.Item
             {...formItemLayout}
             label="Country/Region"
           >
           {getFieldDecorator('country', {
             rules: [{
               required: false, message: 'Please provide your Country !',
             }],
           })(
             <Input readOnly/>
           )

         }

           </Form.Item>
           <Form.Item
             {...formItemLayout}
             label={(
               <span>
                 Nickname&nbsp;
                 <Tooltip title="What do you want others to call you?">
                   <Icon type="question-circle-o" />
                 </Tooltip>
               </span>
             )}
           >
             {getFieldDecorator('nickname', {
               rules: [{ required: true, message: 'Please input your nickname!', whitespace: true }],
             })(
               <Input readOnly/>
             )}
           </Form.Item>

           <Form.Item
             {...formItemLayout}
             label="Phone Number"
           >
             {getFieldDecorator('phone', {
               rules: [{ required: true, message: 'Please input your phone number!' }],
             })(
               <Input readOnly addonBefore={prefixSelector} style={{ width: '100%' }} />
             )}
           </Form.Item>
           <Form.Item
             {...formItemLayout}
             label="Website"
           >
             {getFieldDecorator('website', {
               rules: [{ required: true, message: 'Please input website!' }],
             })(
               <AutoComplete
                 dataSource={websiteOptions}
                 onChange={this.handleWebsiteChange}
                 placeholder="website"
               >
                 <Input readOnly/>
               </AutoComplete>
             )}
           </Form.Item>
         </Form>

       );
     }
   }

   const user = Form.create({ name: 'userdata' })(UserData);

   export default user;
